(1,	'content:1.content',	'wysiwyg',	'<p><strong>SimWeb</strong>&nbsp;ist eine Agentur fr die entwicklung von Software. Es besteht aus einem jungen, kreativen, dynamischen und fachkundigen Team, das fr seine Kunden in allen Ttigkeitsbereichen Projekte jeder Art und Gre durchfhrt. Wir gehen auf Ihre Bedrfnisse ein, indem wir Ihnen unser gesamtes Know-how im Bereich der Multiplattform-Web- und Mobilentwicklung zur Verfgung stellen.</p>\n\n<p>Wir bemhen uns, Ihre Probleme zu verstehen, und sind bestrebt, bessere Fragen zu stellen, um Ihr Unternehmen zu verbessern.</p>\n\n<ul>\n	<li><strong>Mobile-Entwicklung</strong></li>\n	<li><strong>Web-Entwicklung</strong></li>\n	<li><strong>Leistungsfhigkeit</strong></li>\n	<li><strong>Docker</strong></li>\n</ul>\n'),
