INSERT INTO `object_store_5` (`oo_id`, `title`, `publishedAt`, `image`, `autoPublished`, `slug`, `content`) VALUES
(26,	'Arbeit mit Docker',	1631285100,	27,	1,	'arbeit_mit_docker',	'<h2>Docker updates subscription model to deliver scale, speed, and security</h2>\n\n<h5>The updated Docker subscription tiers deliver the productivity and collaboration developers rely on, paired with the security and trust businesses demand. Docker subscription tiers now include Personal, Pro, Team, and Buisness.</h5>\n'),
(27,	'Featured Post Title',	1631281500,	17,	1,	'featured_post_title',	'<p>Science is an enterprise that should be cherished as an activity of the free human mind. Because it transforms who we are, how we live, and it gives us an understanding of our place in the universe.</p>\n\n<p>The universe is large and old, and the ingredients for life as we know it are everywhere, so there\'s no reason to think that Earth would be unique in that regard. Whether of not the life became intelligent is a different question, and we\'ll see if we find that.</p>\n\n<p>If you get asteroids about a kilometer in size, those are large enough and carry enough energy into our system to disrupt transportation, communication, the food chains, and that can be a really bad day on Earth.</p>\n\n<h2>I have odd cosmic thoughts every day</h2>\n\n<p>For me, the most fascinating interface is Twitter. I have odd cosmic thoughts every day and I realized I could hold them to myself or share them with people who might be interested.</p>\n\n<p>Venus has a runaway greenhouse effect. I kind of want to know what happened there because we\'re twirling knobs here on Earth without knowing the consequences of it. Mars once had running water. It\'s bone dry today. Something bad happened there as well.</p>\n'),
(28,	'Home Office',	1631282400,	19,	0,	'home_office',	'<p>Sichern Sie Ihre telefonische Erreichbarkeit. Leiten Sie Ihre Anrufe zum Telefonservice von TELiAS um, wenn Sie im Home Office sind:</p>\n\n<ul>\n	<li>Halten Sie zufriedene Kunden durch zuverlssige Erreichbarkeit</li>\n	<li>Keine aufwndige Telefonanlagen-Programmierung o.. - einfache Anrufweiterschaltung</li>\n	<li>Innerhalb weniger Minuten einsatzbereit</li>\n	<li>Mitarbeiterliste anlegen, um alle Kollegen erreichbar zu machen</li>\n	<li>Mitarbeitersekretariat fr Mitarbeiter mit besonderer Zustndigkeit und Arbeitszeiten</li>\n	<li>Dauerhaft oder bei Bedarf aktivierbar</li>\n</ul>\n\n<h3>Das spricht fr TELiAS</h3>\n\n<ul>\n	<li>17 Jahre Erfahrung</li>\n	<li>Nur festangestellte Mitarbeiter</li>\n	<li>Garantiert keine Warteschleife</li>\n	<li>Von Kunden empfohlen und mehrfach ausgezeichnet</li>\n	<li>Wir sind persnlich, verantwortlich und fair</li>\n</ul>\n'),
(29,	'Pimcore Beste CMS',	1631289600,	28,	0,	'pimcore_beste_cms',	'<h1>EFFIZIENTE LSUNGEN VOM PIMCORE GOLD PARTNER</h1>\n\n<p>Mit&nbsp;Pimcore&nbsp;bringen Sie Ihr Datenmanagement auf ein neues Level: schnell, effizient und ohne zustzliche Lizenzkosten. Die preisgekrnte Open Source-Unternehmensplattform verbindet Stammdatenmanagement (PIM / MDM), User Experience Management (CMS / UX), Digital Asset Management (DAM) und eCommerce. Als erfahrener Pimcore Gold-Partner der ersten Stunde begleitet Intera Sie bei der Einfhrung und Ausgestaltung der damit verbundenen Digitalisierungsprojekte.</p>\n');
